import { useShowsContext } from "../../../contexts/ShowsConext";
import { ShowCard } from "../../shared/ShowCard/ShowCard";
import styles from './NewestMovies.module.css';

export const NewestMovies = () => {
    const { moviesList } = useShowsContext();
    console.log(moviesList);

    return (
        <section>
            <h2 className={styles.title}>Newest Movies <i class="fa-solid fa-arrow-right"></i></h2>
            <div className={styles.movies}>
                {moviesList.length > 0 ? moviesList.map(x =>
                    <ShowCard key={x.id} show={x.fields} id={x.id} />)
                    : <p style={{ color: 'red', fontSize: '22px' }}>Nothing to show</p>}
            </div>
        </section>
    );
};
